import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/GameStyle.module.css';
const InputPad = (props) =>{
//     const [style,setStyle] = React.useState({});
//     setTimeout(()=>{
//      const newStyle={
//          left:`${props.Xcoords}`,
//          top:`${props.Ycoords}`,
//          opacity:1
//     }
//     console.log(props.Xcoords)
//     setStyle(newStyle)
// },1000)
    return(
        <div className={classes.PadContainer} style={{left:500}} >
            <ul className={classes.Padstyle}  >
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
                <li>8</li>
                <li>9</li>
            </ul>
        </div>
    )
}
export default InputPad;
